/** @jsxImportSource theme-ui */
import {
  IonBackButton,
  IonButtons,
  IonCard,
  IonCardContent,
  IonCardHeader,
  IonCardSubtitle,
  IonCardTitle,
  IonCol,
  IonContent,
  IonDatetime,
  IonGrid,
  IonHeader,
  IonIcon,
  IonItem,
  IonLabel,
  IonMenuButton,
  IonPage,
  IonRow,
  IonTitle,
  IonToolbar,
} from "@ionic/react";
import { sad, sadOutline } from "ionicons/icons";
import React, { useState } from "react";
import CalCard from "../../components/Card/CalCard";

const Calendar: React.FC = () => {
  const [time, setTime] = useState(new Date().toISOString());
  const [bookings, setBookings] = useState([
    {
      bookingId: "",
      clientName: "Test",
      clientSurname: "Test",
      complexName: "Test",
      packageName: "Test",
      price: "57",
      startTime: new Date().toDateString(),
      endTime: new Date().toDateString(),
    },
  ]);
  const updateTime = (currentTime: any) => {
    setTime(currentTime);
  };
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar color="primary">
          <IonButtons slot="start">
            <IonMenuButton />
          </IonButtons>
          <IonTitle>Calendar</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonGrid>
          <IonRow>
            <IonCol>
              <IonItem>
                <IonLabel>Select a date</IonLabel>
                <IonDatetime
                  min="2021"
                  value={time}
                  onIonChange={(e) => updateTime(e.detail.value)}
                />
              </IonItem>
            </IonCol>
          </IonRow>
          {bookings[0].bookingId !== "" &&
            bookings.map((booking) => (
              <CalCard
                key={booking.bookingId}
                name={booking.clientName}
                surname={booking.clientSurname}
                complexName={booking.complexName}
                packageName={booking.packageName}
                price={booking.price}
                startTime={booking.startTime}
                endTime={booking.endTime}
              />
            ))}

          {bookings[0].bookingId === "" && (
            <IonRow sx={styles.row}>
              <IonCol>
                <p sx={styles.heading}>No Bookings </p>
              </IonCol>
            </IonRow>
          )}
        </IonGrid>
      </IonContent>
    </IonPage>
  );
};

export default Calendar;

const styles = {
  heading: {
    display: "flex",
    justifyContent: "center",
    color: "#5b9f4e",

    icon: {
      pt: "10px",
      size: 40,
      color: "#5b9f4e",
    },
  },
  row: {
    mt:'30vh',
    mr:'10vh',
    ml:'10vh',
    border: '3px solid #5b9f4e',
    borderRadius: '8px',
    opacity: '0.55'
  },
};
